describe('Floating element alignment issue validation', () => {
    let editor: DocumentEditor = undefined;
    beforeAll(() => {
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        DocumentEditor.Inject(Selection, Editor)
        editor = new DocumentEditor({ isReadOnly: false, enableEditor: true, layoutType: 'Continuous' });
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((done) => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(function () {
            done();
        }, 1000);
   });
   it('Floating element alignment issue validation', () => {    
       console.log("Floating element alignment issue validation");
      editor.open(JSON.stringify(sample));
      editor.selection.goToHeader();
      let paragraph:ParagraphWidget=editor.selection.start.paragraph as ParagraphWidget;
      expect(paragraph.paragraphFormat.leftIndent).toBe(-9);
      let elementBox:any=paragraph.floatingElements[0]; 
      expect(elementBox.x).toBe(48);
   });
});